import { LOCALES } from "../locales";

export default {
  [LOCALES.GERMAN]: {
    hello: "Hallo, {name}!",
    login: "Anmeldung",
    loginpage: "Loginseite",
    register: "registrieren",
    registerpage: "Registrierungsseite",
    home: "Zuhause",
  },
};
